import React from "react";

class LoggedInNavbar extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            platform: navigator.userAgentData.platform,
            email: sessionStorage.getItem('email'),
            admin: false,
        }
    }

    removeSession(){
        sessionStorage.clear();
    }

    getPlatform() {
        if (sessionStorage.getItem('email') === 'admin@gmail.com'){
            this.setState({admin:true})
            return (
                <>
                    <li className="nav-item">
                        <a className="nav-link" href="/showPrescriptions">Show
                            Prescriptions</a>
                    </li>
                    <li className="nav-item">
                        <a className="nav-link" href="/"> Create medicine</a>
                    </li>
                    <li className="nav-item">
                        <a className="nav-link" href="/showMedicines"> Show medicines</a>
                    </li>
                    <li className="nav-item">
                        <a className="nav-link" href="/showBugs"> Show Bugs</a>
                    </li>
                </>
            )}
        else {
            if (this.state.platform === "Android")
                return (
                    <>
                        <li className="nav-item">
                            <a className="nav-link" href="/showPrescriptions">Show
                                Prescriptions</a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" href="/">Connect to machine</a>
                        </li>
                    </>
                )
            else
                return (
                    <>
                        <li className="nav-item">
                            <a className="nav-link" href="/createPrescription">Create
                                Prescription <span
                                    className="sr-only">(current)</span></a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" href="/showPrescriptions">Show
                                Prescriptions</a>
                        </li>
                    </>
                )
        }
    }

    render() {
        return (
            <>
                <a className="navbar-brand" ><strong>Pharmacy Vending Machine</strong></a>
                <button className="navbar-toggler" type="button" data-toggle="collapse"
                        data-target="#navbarSupportedContent-6"
                        aria-controls="navbarSupportedContent-6" aria-expanded="false"
                        aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"/>
                </button>
                <div className="collapse navbar-collapse justify-content-between" id="navbarSupportedContent-6">
                    <ul className="navbar-nav">
                        {this.getPlatform()}
                    </ul>
                    <ul className="navbar-nav">
                        <li className="nav-item">
                            <a className="nav-link" href="/login" onClick={()=>this.removeSession()}>Logout <span
                                className="sr-only">(current)</span></a>
                        </li>
                        {a}
                        <li className="nav-item">
                            <a className="nav-link" href="/reportABug">Report A
                                Bug</a>
                        </li>
                    </ul>
                </div>
            </>
        )

    }
}

export default LoggedInNavbar
